import { makeStyles } from '@material-ui/core/styles';

export default makeStyles((theme) => ({
    navLinks:{
        display: 'flex',
        alignItems: 'left',
        justifyContent: 'space-around',
        marginLeft: theme.spacing(10),
        listStyle: 'none'
    },
    link:{
        textDecoration: 'none',
        margin: 'auto',
        color: 'white'
    }
}

))
